#used for importing a .map file of neurons
def makeNeurons(_path):
    N = {}
    size = 0
    state = -1
    curN = 0
    tempN = {}
    file = open(_path, "r")
    for line in file:
        line = line.rstrip()
        if state == -1:
            size = int(line)+1
            state = 1
        elif line[0] == '-':
            N[curN] = tempN
            tempN = {}
            curN+=1
            state = 1
        elif line[0] == '+':
            while curN < size:
                N[curN] = {}
                curN+=1
            break
        elif state == 1:
            if curN != int(line):
                print("mapping error around: " + str(curN))
            state = 2
        elif state == 2:
            a = re.split("=", line)
            tempN[len(tempN)] = [int(a[0]), int(a[1])]
    return N

def sigmoid(x):
  return 1 / (1 + math.exp(-x))

